import React from 'react';
import { BrowserRouter, Route } from 'react-router-dom';
import { PrimeReactProvider } from 'primereact/provider'; // Adjust import path as per PrimeReact documentation
import Home from './component/home';
import './App.css';

function App() {
  return (
    <PrimeReactProvider>
      <BrowserRouter>
        <Route path="/" exact component={Home}></Route>
      </BrowserRouter>
    </PrimeReactProvider>
  );
}

export default App;
